import * as React from "react";
import { AppData } from "./appdata";
import helpers from "./helpers";

const SkillStars = props => {
  let { state, dispatch } = React.useContext(AppData);
  const tabdata = props.tabdata;
  return (
    <dl className="galaxy">
      {tabdata.map((data, index) => {
        let stars = helpers.twinkleTwinkle(data.prof, 5);
        return (
          <React.Fragment>
            <dt className="res-skill">{data.name}</dt>
            <dd className="res-years">{data.years}</dd>
            <dd
              className="res-score"
              data-score={data.prof}
              dangerouslySetInnerHTML={{ __html: stars }}
            ></dd>
          </React.Fragment>
        );
      })}
    </dl>
  );
};
/*

starList += template({ 
    name: 			skilldata[x].name,
    years: 			skilldata[x].years,
    score: 			skilldata[x].prof,
    stars: 			twinkleTwinkle(skilldata[x].prof, max)
});
*/
export default SkillStars;
